	CREATE TABLE IF NOT EXISTS users (
		id integer PRIMARY KEY AUTOINCREMENT,
		username text,
		password text,
		auth_token text
	);

	CREATE TABLE IF NOT EXISTS services (
		id integer PRIMARY KEY AUTOINCREMENT,
		target text,
		bandwidth text,
		time text,
		price real
	);

	CREATE TABLE IF NOT EXISTS requests (
		id integer PRIMARY KEY AUTOINCREMENT,
		user_id integer,
		service integer, 
		target text,
		payment_received integer
	);


